class Particle {
	constructor() {
		this.x = Math.random() * particleCanvas.width;
		this.y = Math.random() * particleCanvas.height;
		// this.x = mouse.x;
		// this.y = mouse.y;
		// this.size = Math.random() * 7 + 2;
		this.size = (particleCanvas.width * 0.3) / 100;
		this.dX = Math.random() * 3 - 1.5;
		this.dY = Math.random() * 3 - 1.5;
		this.color = color1;
	}
	update() {
		if (this.x + this.size > particleCanvas.width || this.x < 0) {
			this.dX = -this.dX;
		}
		if (this.y + this.size > particleCanvas.height || this.y < 0) {
			this.dY = -this.dY;
		}
		this.x += this.dX;
		this.y += this.dY;
		// if (this.x > canvas.width || this.y > canvas.height || this.x === 0 || this.y === 0) {
		// 	this.speedX = -this.speedX;
		// 	this.x += this.speedX;
		// 	this.speedY = -this.speedY;
		// 	this.y += this.speedY;
		// }
	}
	draw() {
		ctx.fillStyle = this.color;
		ctx.beginPath();
		ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
		ctx.fill();
	}
}

function init() {
	for (let i = 0; i < 10; i++) {
		particleArray.push(new Particle());
	}
}
init();

function handleParticle() {
	for (let i = 0; i < particleArray.length; i++) {
		particleArray[i].update();
		particleArray[i].draw();
		// For checking the distance between each particle we use for loop
		// to prevent it checking already looped particle we use j=i declaration
		for (j = i; j < particleArray.length; j++) {
			const dx = particleArray[i].x - particleArray[j].x;
			const dy = particleArray[i].y - particleArray[j].y;
			const distance = Math.sqrt(dx * dx + dy * dy);
			if ((distance < particleCanvas.width / 2) & (distance > particleCanvas.width / 4)) {
				ctx.beginPath();
				ctx.strokeStyle = particleArray[i].color;
				// ctx.lineWidth = particleArray[i].size / 10;
				ctx.lineWidth = 1;

				ctx.moveTo(particleArray[i].x, particleArray[i].y);
				ctx.lineTo(particleArray[j].x, particleArray[j].y);
				ctx.stroke();
				ctx.closePath();
			}
		}
		// console.log('particle size', particleArray[i].size);
		if (particleArray[i].size <= 0.3) {
			particleArray.splice(i, 1);
			// Since we are deleting element from somewhere in the middle
			// if we don't minus one from 'i', the next element will skip in the for loop
			// because array length is reduced in if loop. and it will create glich in the animation
			i--;
		}
	}
}

function animate() {
	ctx.clearRect(0, 0, particleCanvas.width, particleCanvas.height);
	// ctx.globalAlpha = 0.3;
	ctx.fillStyle = 'rgba(0,0,0,0.5)';
	ctx.fillRect(0, 0, particleCanvas.width, particleCanvas.height);
	handleParticle();
	requestAnimationFrame(animate);
}

animate();
